import React from "react";
import NavH from "./NavHeader";
import Search from "./SearchBar";

function PageHeader(props) {
    return (
        <header className="App-header">
            <section class="head-page">
                <h1>
                    <a href="/">{props.heading}</a>
                </h1>
                <div>
                    <NavH />
                    <Search />
                </div>
            </section>
        </header>
    )
}

export default PageHeader;
